import React from "react";

export default function About() {
    return (
        <section className="about-section">
            <h2>About</h2>
            <p>I am a Fullstack web developer with over a decade of experience working with web development technologies like Javascript, HTML, CSS, Nodejs, jQuery, React, Python, Flask, Django, C, C++, PHP and Java
            </p>
        </section>
    );
}
